window.bookSummaryJSON = "<p><b>She's willing to give up everything.</b></p> <p><b>He's willing to give up everythingâ€”except her.</b></p> <p>Clara has been patient, waiting for her opportunity. Now, the time has come. She will command the Prince of the Doomed City himself to aid her in her quest. Together they must travel to the various courts of Eledria, facing foes and monsters, each more deadly than the last, as Clara strives to save her childhood sweetheart from enslavement.</p> <p>Each new bargain tangles her in a web of intrigue far more dangerous than she ever imagined, for there are other players in this game, other bargains being made. Worse still, she finds herself becoming irresistibly drawn to the enigmatic Prince who has come to mean more to her than she dares admit.</p> <p>When a final, most deadly bargain pushes the Prince to take drastic action, will Clara learn too late where her heart truly lies?</p> <p>Return to the Prince of the Doomed City series to wander through the dangerous realms of the fae with Clara and her Prince. Fair warning: this book will break your heart! (But I promise to mend it in the next one.)</p>"; 
